import './App.css';
import PropTypes from 'prop-types';

{/* props : 부모 컴포넌트에서 자식 컴포넌트로 데이터를 전달하는 매개변수 */}
{/* props 는 읽기 전용 */}
// 사용법 :

// 1. 컴포넌트 명(props){
// {props.부모가 전달한 키이름}
// }

// 2. 컴포넌트명 ({부모가 전달한 키 이름, ...}){
//      {키 이름1, 키 이름2, ...}
//     console.log({키이름1}); << ㅡㅡ 이러한 형태로 동작함.
// }

// 3. 컴포넌트명(props){
//     const {키이름, ...} = props;
//     console.log({키이름}); << ㅡㅡ 이러한 형태로 동작함.
// }
function Food( {name, pic,rating} ){
    return(
        <div>
            <h3>I Love {name}</h3>
            <h4>{rating} / 5.0 </h4>
            <img src={pic} />
        </div>
    );
}
const foodList =
    [   {id:1,
        name:"돈가스",
        rating: 4.5,
        image: "data:image/jpeg;base64,"},
        {id:2,
            name:"햄버거",
            rating: 4.3,
        image: "data:image/jpeg;base64,"},
        {id:3,
            name: "돼지국밥",
            rating: 4.3,
            image:"data:image/jpeg;base64,"}
    ];

    function renderFood(dish){
        return <Food key={dish.id} name={dish.name} pic={dish.image} rating={dish.rating} />

    }
function App() {
    // 이 곳은 일반적인 js 소스코드 부분
    return (
        // return 다음에 나오는 부분이 화면 렌더링 부분이다 부모 태그는 반드시 1개만 존재해야 함.
        // 화면 그려주는 부분을 작성 태그를 한줄로 표현 시, 리턴뒤에 괄호 생략
        //jsx 문법에서 class 라는 키워드는 자바스크립트의 클래스 키워드와 겹치기 대문에 자바스크립트의 클래스와 css선택자의 class를
        // 구분하기 위해서 css 선택자인 class를 className이라고 한다.
        <div className="App">
            {/* SPA : Single Page Application 의 줄임말, index.html 과 같은 하나의 화면 구성 파일로 모든 화면을 구성하는 웹페이지 */}
            {/* SPA는 프론트엔드 프레임워크를 사용하여 하나의 화면에서 필요한 부분을 실시간으로 변경하여 웹을 표시함, 해당 화면을 구성하는 요소를 컴포넌트라고 함. */}
            {/* 컴포넌트 : 리액트에서 화면을 구성하는 요소 */}
            {/* {} : jsx 문법에서 {} 데이터를 표현하는데 사용함, 간단한 연산식도 사용이 가능 */}
            {/*<Potato />*/}
            {/* food라는 컴포넌트에 변수명이 fav이고, 값이 kimchi인 데이터를 props에 담아 전달 */}

            {/*<Food fav={"Kimchi"} />*/}
            {/*<Food fav={"돈까스"} />*/}
            {/*<Food fav={"햄버거"} />*/}
            {/*<Food fav={"샌드위치"} />*/}
            <h1>리액트 사용하기</h1>
            {/*{foodList.map(dish => (<Food name={dish.name} pic={dish.image} rating={dish.rating} />))}*/}
            {foodList.map(dish => renderFood(dish))}

        </div>

        // <div> <<ㅡㅡ div 하나를 더 사용하면 바로 에러가 표시됨.

        // </div>
    );
}

// 매개변수로 사용되는 데이터를 체크
// 매개변수의 이름까지 체크
// isRequired : 해당 부분이 반드시 필요하다는 의미, 없으면 오류발생.
Food.propTypes ={
        name: PropTypes.string.isRequired,
        pic: PropTypes.string.isRequired,
        rating:PropTypes.number.isRequired
}

export default App;